		<StyledMenu>
			<UnodoredListitem>
				{props.menuItems.map((el) => (
					<ListItem>
						<Link href="">{el}</Link>
					</ListItem>
				))}
			</UnodoredListitem>
		</StyledMenu>
	);
}

